import React, { useEffect, useState } from "react";
import { Container, Row, Col } from "reactstrap";

const MemberCard = props => {
  return (
    <div>
      <p>{props.mem.name}</p>
      <p>{props.mem.role}</p>
      <p>{props.mem.email}</p>
    </div>
  );
};

export default MemberCard;
